import React from 'react';
import './App.css';
import Linda from './images/lindaWooHeadShot.jpeg';

function App() {
  return (
    <div className="App">
     <p>hello Linda Woo</p>
     <img src = {Linda} />
    </div>
  );
}
export default App;
